import React from 'react';
import back from "../images/BACK.webp";

const Header = () => {
    return (
        <div style={{ position: "relative", height: "810px", width: "100%" }}>
            <img 
                src={back} 
                alt="Banner" 
                style={{ 
                    height: "100%", 
                    width: "100%", 
                    objectFit: "cover", 
                    position: "absolute", 
                    top: 0, 
                    left: 0 
                }} 
            /> 
            <h1 
                style={{ 
                    position: "absolute", 
                    top: "50%", 
                    left: "50%", 
                    transform: "translate(-50%, -50%)", 
                    color: "white", 
                    textShadow: "2px 2px 4px rgba(0, 0, 0, 0.7)", 
                    zIndex: 1 
                }}
            >
                Content Creator Profile
            </h1>
        </div>
    );
};

export default Header;
